import './App.css';
import LandingPage from './pages/LandingPage';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import NextPage from './pages/NextPage';
import YesPage from './pages/YesPage';
import PlayStart from './pages/PlayStart';
import GamePage from './pages/GamePage';

function App() {
  return (
    <div className="App">
      <svg width="351" height="438" viewBox="0 0 351 438" fill="none" xmlns="http://www.w3.org/2000/svg">
<rect width="351" height="438" rx="69" fill="white"/>
</svg>

      <BrowserRouter>
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/next" element={<NextPage />} />
          <Route path="/confirm" element={<YesPage />} />
          <Route path="/method" element={<PlayStart />} />
          <Route path="/game" element={<GamePage />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
